const BioData = ({ person }) => {
  return (
    <div className="bg-slate-700 p-5 m-5 md:m-10 rounded-md">
      <div className="flex flex-col-reverse sm:flex-row items-center justify-center sm:justify-between gap-5">
        <div className="">
          <h2 className="text-2xl font-bold">{person.name}</h2>
          <h3 className="text-lg font-semibold">{person.profession}</h3>
          <h3 className="mb-3  font-semibold">{person.address}</h3>
          <ul>
            <li>Phone: {person.contact.phone}</li>
            <li>
              Email:{" "}
              <a href="" className="text-blue-500 underline">
                {person.contact.email}{" "}
              </a>{" "}
            </li>
            <li>
              Github:{" "}
              <a href="" className="text-blue-500 underline">
                {person.contact.github}{" "}
              </a>{" "}
            </li>
            <li>
              Website:{" "}
              <a href="" className="text-blue-500 underline">
                {person.contact.website}{" "}
              </a>{" "}
            </li>
          </ul>
        </div>
        <img
          src={person.image}
          alt="profilePic"
          className="w-64 rounded-lg object-cover shadow-xl shadow-slate-500/50"
        />
      </div>
    </div>
  );
};
export default BioData;
